import React from 'react';
import '../../App.css';

export default function Services() {
  return (
    <>
      <h1 className="products">Gallery</h1>
      <React.StrictMode>
        <SimpleReactLightBox>
        <div className="App">
          <div className="tags">
            <TagButton
              name="all"
              tagActive={tag === "all" ? true : false}
              handleSetTag={setTag}
            />{" "}
            /
            <TagButton
              name="sushi"
              tagActive={tag === "sushi" ? true : false}
              handleSetTag={setTag}
            />{" "}
            /
            <TagButton
              name="kitchen food"
              tagActive={tag === "kitchen " ? true : false}
              handleSetTag={setTag}
            />{" "}
            /
            <TagButton
              name="other"
              tagActive={tag === "other" ? true : false}
              handleSetTag={setTag}
            />
          </div>
          <SRLWrapper options={options}>
            <div className="container">
              {filteredImages.map((image) => (
                <div key={image.id} className="image-card">
                  <a href={`/imagesGallery/${image.imageName}`}>
                    <img
                      className="image"
                      src={`/imagesGallery/${image.imageName}`}
                      alt=""
                    />
                  </a>
                </div>
              ))}
            </div>
          </SRLWrapper>
        </div>
        </SimpleReactLightBox>
      </React.StrictMode>
      <Footer />
    </>
  );
}

const TagButton = ({ name, handleSetTag, tagActive }) => {
  return (
    <button
      className={`tag ${tagActive ? "active" : null}`}
      onClick={() => handleSetTag(name)}
    >
      {name.toUpperCase()}
    </button>
  );
}
